import React from 'react';

import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import FlagIcon from '@mui/icons-material/Flag';
import QueryBuilderIcon from '@mui/icons-material/QueryBuilder';
import CloseIcon from '@mui/icons-material/Close';

import DataNotPresent from '../DataNotPresent/DataNotPresent';

import {
   TableContainer,
   Table, TableHead, TableBody,
   TableRow, TableCell, Paper
} from '@mui/material';

export default function LiftStatus(props) {
   const liftStatus = !props.status ? <DataNotPresent /> :
      <div>Lift Status here!!</div>

   console.log(liftStatus);
   return (
      { liftStatus }
   );
}
